import {
  Stack,
  Button,
  Container
} from "@mui/material";

import Menus from '../Json-api/Menu';

const Navbar = ()=>{
  const Buttons = ({data})=>{
    console.log(data);
  }
  const design = (
    <>
      <Stack>
      <Container sx={{m:4}}>
        <Stack direction="row" justifyContent="space-between">
         <h4>Testing</h4>
          <Stack direction="row" spacing={1}>
          {
            Menus.map((menu)=>{
              return <Buttons data={menu} key={menu.id} />
            })
          }
          </Stack>
          </Stack>
        </Container>
      </Stack>
    </>
  );
  return design;
}
export default Navbar;
